  nationality.1.t: "Сложение германских культур"
  nationality.1.d: "Становление германских культур"
  nationality.1.a: "Endlich, etwas Kultur !"

  nationality.2.t: "Становление скандинавских культур"
  nationality.2.d: "Становление скандинавских культур"
  nationality.2.a: "Slutligen, en del kultur !"

  nationality.3.t: "Сложение британских культур"
  nationality.3.d: "Сложение британских культур"
  nationality.3.a: "Наконец-то, немного культуры!"

  nationality.4.t: "Набор итальянских культур"
  nationality.4.d: "Становление итальянских культур"
  nationality.4.a: "Finalmente, una cultura !"

  nationality.5.t: "Становление иберийских культур"
  nationality.5.d: "Становление иберийских культур"
  nationality.5.a: "Finalmente, algo de cultura !"

  nationality.6.t: "Становление французских культур"
  nationality.6.d: "Становление французской культуры"
  nationality.6.a: "Enfin, de la culture!"

  nationality.7.t: "Становление южнославянских культур"
  nationality.7.d: "Становление южнославянских культур"
  nationality.7.a: "Konačno, neka kultura !"

  nationality.8.t: "Становление общеалбанских культур"
  nationality.8.d: "Становление общеалбанских культур"
  nationality.8.a: "Së fundi, një kulturë!"

  nationality.9.t: "Становление общерумынских культур"
  nationality.9.d: "Становление панрумынских культур"
  nationality.9.a: "În cele din urmă, o cultură!"

  nationality.10.t: "Становление венгерских культур"
  nationality.10.d: "Становление венгерских культур"
  nationality.10.a: "Végül, valamilyen kultúra!"

  nationality.11.t: "Сложение польских культур"
  nationality.11.d: "Становление польских культур"
  nationality.11.a: "Wreszcie, trochę kultury!"

  nationality.12.t: "Становление чехо-словацкой культуры"
  nationality.12.d: "Становление чехо-словацких культур"
  nationality.12.a: "Konečně, nějaká kultura!"

  nationality.13.t: "Становление восточнославянских культур"
  nationality.13.d: "Становление восточнославянских культур"
  nationality.13.a: "Наконец-то, немного кул'тури!"

  nationality.14.t: "Становление балтийских культур"
  nationality.14.d: "Сложение балтийских культур"
  nationality.14.a: "Galiausiai, tam tikra kultūra!"

  nationality.15.t: "Становление эллинских культур"
  nationality.15.d: "Становление эллинских культур"
  nationality.15.a: "Télos, kápoia koultoúra!"

  nationality.16.t: "Становление турко-семитских культур"
  nationality.16.d: "Становление турко-семитских культур"
  nationality.16.a: "Sonunda, bazı kültür !"

  nationality.17.t: "Становление кавказских культур"
  nationality.17.d: "Сложение кавказских культур"
  nationality.17.a: "Da bolos, zogierti k'ult'ura!"

  nationality.18.t: "Становление арабских культур"
  nationality.18.d: "Сложение арабских культур"
  nationality.18.a: "'Akhiraan , bed althaqafa" !"

  nationality.19.t: "Становление бенилюкских культур"
  nationality.19.d: "Сложение культур Бенилюкса"
  nationality.19.a: "Eindelijk, wat cultuur !"

